import React, { useCallback } from "react";
import { useForm, FormProvider } from "react-hook-form";
import { Grid, Button, DialogTitle, DialogContent, DialogContentText, DialogActions, makeStyles, Theme } from "@material-ui/core";
import InputForm from './InputForm';

interface ISignInFormData
{
    login: string,
    password: string
}

interface ISignInFormProps
{
    handleClose(): void
}

const useStyles = makeStyles((theme: Theme) => ({
    title: {
        alignSelf: "center"
    },
    buttonContainer: {
        justifyContent: "center"
    },
    button: {
        marginInline: 20
    }
}));

const SignInForm: React.FC<ISignInFormProps> = ({ handleClose }) => {

    const styles = useStyles();
    const methods = useForm();
    const { handleSubmit } = methods;
    const onSubmit = (formValues: ISignInFormData) => {
        handleClose();
        console.log("test");
        console.log(formValues);
    };

    return(
        <FormProvider {...methods}>
            <DialogTitle id="form-dialog-title" className={styles.title}>
                Sign In
            </DialogTitle>
            <DialogContent>
            <DialogContentText>
                Please, fill fields to sign in
            </DialogContentText>
            <form>
                <InputForm name="login" label="Login(Username/Email)" autoFocus={true} />
                <InputForm name="password" label="Password" />
            </form>
            <DialogActions className={styles.buttonContainer}>
                <Button 
                    variant="contained" 
                    color="primary"
                    onClick={handleSubmit(onSubmit)}
                    className={styles.button}
                    >
                    Sign In
                </Button>
                <Button 
                    variant="contained" 
                    color="primary"
                    onClick={handleClose}
                    className={styles.button}
                    >
                    Cancel
                </Button>
            </DialogActions>
            </DialogContent>
        </FormProvider>
    );
}

export default SignInForm;

